class Solution(object):
    def robotWithString(self, s):
        """
        :type s: str
        :rtype: str
        """
        L = len(s)

        # pre-process
        minis = list()
        mini_val = 'z'
        mini_idx = L - 1
        for x in range(L - 1, -1, -1):
            if s[x] <= mini_val:
                mini_val = s[x]
                mini_idx = x
            minis.append([mini_val, mini_idx])
        minis = minis[::-1]

        # process
        stack = list()
        idx = 0
        ans = ""
        while len(ans) < L:
            if idx < L:
                if stack and stack[-1] <= minis[idx][0]:
                    ans += stack[-1]
                    stack.pop()
                else:
                    limit = minis[idx][1]
                    for x in range(idx, limit):
                        stack.append(s[x])
                    ans += s[limit]
                    idx = limit + 1
            else:
                ans += "".join(stack[::-1])
        return ans


s = "zza"
s = "bac"
s = "bdda"
s = "therisfdbaifsvsfnds"
s = "d"
s = ""

solution = Solution()
print(solution.robotWithString(s))
